#!/usr/bin/env python3
# coding: utf-8
from collections import Counter, defaultdict, deque
from heapq import merge
import unittest


class Solution:
    def findSubstring(self, s, words):
        ls, nwords = len(s), len(words)
        if ls == 0 or nwords == 0 or ls < len(words[0]):
            return []

        word_size = len(words[0])
        window_size = word_size * nwords
        if ls < window_size:
            return []

        # We start by generating a sorted list with the indexes where
        # the words occur in s
        idx = defaultdict(list)
        word_set = set(words)
        i = 0
        while i < ls - word_size + 1:
            if s[i:i+word_size] in word_set:
                idx[s[i:i+word_size]].append(i)
            i += 1

        indexes = merge(*idx.values())

        res = []
        occurrences = Counter(words)

        for i in indexes:
            c = defaultdict(int)
            total = nwords
            ws = window_size
            j = i
            while ws > 0 and j < ls - word_size + 1:
                if s[j:j+word_size] in occurrences:
                    c[s[j:j+word_size]] += 1
                    if c[s[j:j+word_size]] > occurrences[s[j:j+word_size]]:
                        break
                    total -= 1

                if total == 0:
                    res.append(i)
                    break

                j += word_size
                ws -= word_size

            c = None

        return res


